export default class Employee {
    constructor() {
        this.EmployeeID = null;
        this.ManagerID = null;
        this.EmployeeCode = '';
        this.FirstName = '';
        this.LastName = '';
        this.CreatedOn = null;
        this.Roles = [];
    }
}
